import { HeaderContent, HeaderLogo } from './HeaderStyled';

const Header = () => {

    return (
        <HeaderContent>
            <HeaderLogo>
                <div>Brave developers terminal</div>
            </HeaderLogo>
        </HeaderContent>
    )
}

export default Header
